import React, { useState } from 'react';
import {
    Box,
    Typography,
    List,
    ListItem,
    ListItemText,
    ListItemSecondaryAction,
    IconButton,
    Tooltip,
    Collapse
} from '@mui/material';
import RestoreIcon from '@mui/icons-material/Restore';
import DeleteIcon from '@mui/icons-material/Delete';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';

const SearchHistory = ({ history, onRestoreSearch, onDeleteSearch }) => {
    const [expandedItem, setExpandedItem] = useState(null);

    return (
        <Box sx={{ mt: 2 }}>
            <Typography variant="h6" gutterBottom>
                Siste søk
            </Typography>
            <List>
                {history.map((item) => (
                    <React.Fragment key={item.id}>
                        <ListItem 
                            sx={{
                                bgcolor: 'background.paper',
                                mb: expandedItem === item.id ? 0 : 1,
                                borderRadius: expandedItem === item.id ? '8px 8px 0 0' : 8,
                                '&:hover': {
                                    bgcolor: 'action.hover'
                                }
                            }}
                        >
                            <ListItemText
                                primary={item.course_name}
                                secondary={
                                    <>
                                        {new Date(item.created_at).toLocaleString('nb-NO')}
                                        <br />
                                        {item.results?.length || 0} resultater funnet
                                    </>
                                }
                            />
                            <ListItemSecondaryAction>
                                <Tooltip title="Vis resultater">
                                    <IconButton 
                                        onClick={() => setExpandedItem(
                                            expandedItem === item.id ? null : item.id
                                        )}
                                    >
                                        {expandedItem === item.id ? 
                                            <KeyboardArrowUpIcon /> : 
                                            <KeyboardArrowDownIcon />
                                        }
                                    </IconButton>
                                </Tooltip>
                                <Tooltip title="Gjenopprett søk">
                                    <IconButton 
                                        onClick={() => onRestoreSearch(item)}
                                        sx={{ mr: 1 }}
                                    >
                                        <RestoreIcon />
                                    </IconButton>
                                </Tooltip>
                                <Tooltip title="Slett fra historikk">
                                    <IconButton 
                                        onClick={() => onDeleteSearch(item.id)}
                                    >
                                        <DeleteIcon />
                                    </IconButton>
                                </Tooltip>
                            </ListItemSecondaryAction>
                        </ListItem>
                        
                        <Collapse in={expandedItem === item.id}>
                            <Box 
                                sx={{ 
                                    bgcolor: 'background.paper',
                                    borderRadius: '0 0 8px 8px',
                                    mb: 1,
                                    p: 2 
                                }}
                            >
                                <Typography variant="subtitle2" gutterBottom>
                                    Topp resultater:
                                </Typography>
                                {item.results?.slice(0, 3).map((result, index) => (
                                    <Box 
                                        key={result.kurskode}
                                        sx={{ 
                                            display: 'flex', 
                                            justifyContent: 'space-between',
                                            alignItems: 'center',
                                            mb: 1 
                                        }}
                                    >
                                        <Typography variant="body2">
                                            {result.kurskode} - {result.kursnavn}
                                        </Typography>
                                        <Typography 
                                            variant="body2" 
                                            color="primary"
                                            sx={{ ml: 2 }}
                                        >
                                            {result.similarity}%
                                        </Typography>
                                    </Box>
                                ))}
                            </Box>
                        </Collapse>
                    </React.Fragment>
                ))}
            </List>
        </Box>
    );
};

export default SearchHistory;
